import ATextField from "./components/aTextfield";

function App() {
  return (
    <div className="App">
      <AStepperForm>
        Personal 
        <AStepperFormPart><ATextField name="firstName"/> </AStepperFormPart>
        <AStepperFormPart><ATextField name="lastName"/> </AStepperFormPart>
      </AStepperForm>
      <AStepperForm>
        <AStepperFormPart><ATextField name="Company"/> </AStepperFormPart>
        <AStepperFormPart><ATextField name="Job Title"/> </AStepperFormPart>
      </AStepperForm>
      <AStepperForm>
        <AStepperFormPart><ATextField name=""/> </AStepperFormPart>
        <AStepperFormPart><ATextField name="Job Title"/> </AStepperFormPart>
      </AStepperForm>
    </div>
  );
}

export default App;
